OM OS
MORO er en ny kultur-platform for unge, der ønsker et skræddersyet overblik over oplevelser i det københavnske kulturliv. \n \n Vores team består af 8 unge iværksættere, der tilsammen udgør MORO. Vi var trætte af altid at skulle lede gennem utallige sites og hjemmesider for at finde og udforske de events, der interesserer os. Vi oplevede, at vi tit gik glip af events, fordi vi ikke vidste, hvornår de blev afholdt, eller fordi vi først fik kendskab til dem, efter de var blevet afholdt. Vi savnede overblik og en platform, hvor man nemt og på overskuelig vis, kunne filtrere sin søgning og få optimeret information om lige præcis de events, vi gerne ville deltage i. Vi har derfor startet MORO.
